import React from 'react';
import './Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-left">
                <button>My Account</button>
                <button>Cart</button>
                <button>Contact</button>
            </div>
            <div className="navbar-right">
                bstore
            </div>
        </nav>
    );
}

export default Navbar;
